window.bookSummaryJSON = "<p>Have you always wanted to follow a creative passion but were afraid to do so? Do you feel like there’s an inner artist in you that wants to get out and create? Tap into your creative genius and become an artist with this hypnosis program from Erick Brown. </p> <p>\"Unlock Your Creative Genius\" will help to relax your mind and overcome blocks that you may have in your subconscious that are keeping you from reaching your creative potential. Subliminal suggestions for deep relaxation and positive change will be received by your subconscious, increasing your self-confidence and filling you with positive energy and creative motivation. Don’t wait another day. Unlock your creative genius and embrace your inner artist! “Unlock Your Creative Genius\" includes an instructional track and three hypnosis tracks for you to choose from: </p> <ul> <li>One containing a beach induction that will lull you into a deep state of relaxation with the soothing sounds of waves hitting the shore, allowing you to let go of any mental inhibitions and be completely open to positive change. </li> <li>One containing a staircase induction that will walk you down a mental stairway into a deeply relaxed state that ends with you in a peaceful, safe place where you can feel comfortable enough to completely open up to these hypnotic suggestions. </li> <li>One containing a speed induction that will quickly take you into a deeply relaxed state. Use this track if you are already familiar with the relaxation process and would like to quickly move into deep relaxation. <p>Bonus Track: Deep Sleep Subliminal - This subliminal bonus track can be used with your hypnosis program or on its own for a deep, restful sleep. Binaural beats and solfeggio tones relax your brainwaves and body, melting away tension and stress.</p></li> </ul>"; 
